import {Container, Title, HeaderImage} from '../style/style'
import Image from 'next/image'


function Home () {
    return (
        <Container>
            <Title>
                Ola world
            </Title>
            <Image width="64" height="64"  src="/chess.png"/>
        </Container>
    )
}

export default Home
